        amount={499}
        token={token => console.log(token)}
        stripeKey="pk_test_3kvuoJluTJN33ohWyfBQclKJ"
      >
        <Link to={'#'} className="button is-primary">
          Add jfdqkl
        </Link>
      </StripeCheckout>
    );
  }
}

export default Payments;
